import React, { Component } from 'react';
import { Row, Col, Button, Card, Carousel } from 'antd';


import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
      <h1>Noemi Romano</h1>
      <Row gutter={16}>
      <Col span={12}>
      <h1>A new island in Venice</h1>
      <p>In this project, we imagined a new island in Venice.</p>
      </Col>
      <Col span={12}>

      <Carousel effect='fade'>
      <div><img src={process.env.PUBLIC_URL + '/images/arsenale2.JPG'}></img></div>
      <div><h3>2</h3></div>
      <div><h3>3</h3></div>
      <div><h3>4</h3></div>

      </Carousel>


      </Col>
    </Row>

      </div>
    );
  }
}

export default App;
